import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
 import "owl.carousel/dist/assets/owl.carousel.css";

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
